import './App.css';
import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Header from './containers/Header';
import ProductListing from './containers/ProductListing';
import ProductDetail from './containers/ProductDetail';
import WishList from './containers/WishList';
import Login from './containers/Login';
import Signup from './containers/Signup';
import Mens from './containers/Mens';
import Womens from './containers/Womens';
const LazyMens = React.lazy(() => import('./containers/Mens'));
const LazyWomens = React.lazy(() => import('./containers/Womens'));
const LazyKids = React.lazy(() => import('./containers/Kids'));

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <div className="all-content">
          {/* <div className="image-content">
            <img className="" src="https://images.squarespace-cdn.com/content/v1/547a3834e4b053a861c4874e/ae4ecac8-eb46-460f-9fd1-0d3f29e87c4b/Sustainably+Chic+%7C+Sustainable+Fashion+Blog+%7C+Best+Sustainable+Mens+Clothing+Brands+.jpg?format=1500w"></img>
          </div> */}
        </div>
        <div className="content-container">
          <Switch style={{ marginTop: '10000px' }}>
            <Route path="/home" component={ProductListing} />
            <Route path="/product/:productId" component={ProductDetail} />
            <Route path="/wishlist" component={WishList} />
            <Route path="/login" component={Login} />
            <Route path="/sign-up" component={Signup} />
            <Route path="/mens">
              <React.Suspense fallback="Loading....">
                <LazyMens />
              </React.Suspense>
            </Route>
            <Route path="/women">
              <React.Suspense fallback="Loading...">
                <LazyWomens />
              </React.Suspense>
            </Route>
            <Route path="/kids">
              <React.Suspense fallback="Loading...">
                <LazyKids />
              </React.Suspense>
            </Route>
            <Route>404 Not Found</Route>
          </Switch>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
